import { Space } from 'antd';
import React, { Component } from 'react'
import Link from '../elements/Link';
import '../style.css';

function List(props) {
    return (
        <div>
            <div className="row">
                <div className="column">
                <a href={props.link1}>
                    <img alt="example" src={props.link} style={{ width: "40px", height: "30px" }} />
                @{props.nama}
                </a>
                </div>
            </div>
            <Link primary href={props.link1}>

                <img alt="example" src={props.link} style={{ width: "40px", height: "30px" }} />
                @{props.nama}
                </Link>
        </div>
    )
}

